import "./App.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import { React, useState } from "react";
import { NavBarComponent } from "./Views/NavBarComponent";
import { MovieCard } from "./Views/MovieCard";

const App = () => {
  const [moviesList, setMoviesList] = useState([]);

  return (
    <div className="App">
      <NavBarComponent/>
      <MovieCard/>

      {moviesList.map((item) => (
        <li key={item.id}>
          {item.title} - {item.id}
        </li>
      ))}
    </div>
  );
};

export default App;
